[{"location":"","page":"Home","title":"Home","text":"CurrentModule = RabiRamseySpectroscopy","category":"page"},{"location":"#RabiRamseySpectroscopy","page":"Home","title":"RabiRamseySpectroscopy","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for RabiRamseySpectroscopy.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [RabiRamseySpectroscopy]","category":"page"},{"location":"#RabiRamseySpectroscopy.FreeEvol","page":"Home","title":"RabiRamseySpectroscopy.FreeEvol","text":"FreeEvol\n\nStruct for a quantum physics operator that describes evolution of unperturbed quantum two-level system. This evolution can be described in the way of changing phase difference between |e> and |g> states.\n\nFields\n\noperator:   Represents operator itself in a form of a matrix.\n\nArguments\n\nx :   The phase difference between |e> and |g> states   as a result of free evolution.\n\nReturns\n\nFreeEvol :   Composite type instance.\n\nSee also\n\nStateVector\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Two-statequantumsystem\n\n\n\n\n\n","category":"type"},{"location":"#RabiRamseySpectroscopy.PerturbEvol","page":"Home","title":"RabiRamseySpectroscopy.PerturbEvol","text":"PerturbEvol\n\nStruct for a quantum physics operator that describes evolution of quantum two-level system in a presence of some perturbation field.\n\nFields\n\noperator:   Represents operator itself in a form of a matrix.\n\nArguments\n\nδ :   The detuning, a measure of how far the perturbation field oscillation frequency is   off-resonance relative to the transition   (Hz).\nτ :   The duration of Rabi/Ramsey pulse   (s).\nΩ₀ :   The Rabi frequency at which the probability amplitudes of two energy levels fluctuate   in an oscillating perturbation field   (Hz).\n\nReturns\n\nPerturbEvol :   Composite type instance.\n\nSee also\n\nStateVector\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Two-statequantumsystem\nWikipedia: https://en.wikipedia.org/wiki/Rabi_frequency\n\n\n\n\n\n","category":"type"},{"location":"#RabiRamseySpectroscopy.StateVector","page":"Home","title":"RabiRamseySpectroscopy.StateVector","text":"StateVector\n\nStruct that describes a state of the quantum two-level system via ket vector in Dirac notation.\n\nFields\n\nstate :   Vector that represents the state of the system in (|e>, |g>) basis.\n\nArguments\n\ne :   Numerical value that implies the probability of a quantum system to be in excited state   or the amount of particles in the ground state.   Value of |e> ket vector.\ng :   Numerical value that implies the probability of a quantum system to be in ground state   or the amount of particles in the ground state.   Value of |g> ket vector.\n\nReturns\n\nStateVector :   Composite type instance.\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Two-statequantumsystem\nWikipedia: https://en.wikipedia.org/wiki/Bra%E2%80%93ket_notation\n\n\n\n\n\n","category":"type"},{"location":"#RabiRamseySpectroscopy.probe-Tuple{StateVector}","page":"Home","title":"RabiRamseySpectroscopy.probe","text":"probe(state_vector::StateVector) -> Real\n\nMethod that computes the value of probability nₑ for a quantum system to be in excited state and can be interpret as population of excited state.\n\nArguments\n\nself :   The current state vector of a quantum system.\n\nReturns\n\nnₑ :   Real number.\n\nSee also\n\nRabiRamseySpectroscopy.StateVector\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Ramsey_interferometry\n\n\n\n\n\n","category":"method"},{"location":"#RabiRamseySpectroscopy.pump!-Tuple{StateVector, PerturbEvol}","page":"Home","title":"RabiRamseySpectroscopy.pump!","text":"pump!(self::StateVector, pulse::PerturbEvol) -> StateVector\n\nTransform the state of a quantum system according to system's evolution in a presence of the laser pulse.\n\nArguments\n\nself :   The current state vector of a quantum system.\npulse :   The laser pulse which is applied on the quantum system.\n\nReturns\n\nStateVector :   Composite type instance with transformed state object.\n\nSee also\n\nRabiRamseySpectroscopy.StateVector\nRabiRamseySpectroscopy.PerturbEvol\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Ramsey_interferometry\n\n\n\n\n\n","category":"method"},{"location":"#RabiRamseySpectroscopy.pump-Tuple{StateVector, PerturbEvol}","page":"Home","title":"RabiRamseySpectroscopy.pump","text":"pump(state_vector::StateVector, pulse::PerturbEvol) -> StateVector\n\nTransform the state of a quantum system according to system's evolution in a presence of the laser pulse.\n\nArguments\n\nstate_vector :   The current state vector of a quantum system.\npulse :   The laser pulse which is applied on the quantum system.\n\nReturns\n\nStateVector :   Composite type instance with transformed state object.\n\nSee also\n\nRabiRamseySpectroscopy.StateVector\nRabiRamseySpectroscopy.PerturbEvol\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Ramsey_interferometry\n\n\n\n\n\n","category":"method"},{"location":"#RabiRamseySpectroscopy.wait!-Tuple{StateVector, FreeEvol}","page":"Home","title":"RabiRamseySpectroscopy.wait!","text":"wait!(self::StateVector, duration::FreeEvol) -> StateVector\n\nTransform the state of a quantum system according to system's evolution in a presence of no perturbations.\n\nArguments\n\nself :   The current state vector of a quantum system.\nduration :   The time of free evolution of the quantum system.\n\nReturns\n\nStateVector :   Composite type instance with transformed state object.\n\nSee also\n\nRabiRamseySpectroscopy.StateVector\nRabiRamseySpectroscopy.FreeEvol\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Ramsey_interferometry\n\n\n\n\n\n","category":"method"},{"location":"#RabiRamseySpectroscopy.wait-Tuple{StateVector, FreeEvol}","page":"Home","title":"RabiRamseySpectroscopy.wait","text":"wait(state_vector::StateVector, duration::FreeEvol) -> StateVector\n\nTransform the state of a quantum system according to system's evolution in a presence of no perturbations.\n\nArguments\n\nstate_vector :   The current state vector of a quantum system.\nduration :   The time of free evolution of the quantum system.\n\nReturns\n\nStateVector :   Composite type instance with transformed state object.\n\nSee also\n\nRabiRamseySpectroscopy.StateVector\nRabiRamseySpectroscopy.FreeEvol\n\nReferences\n\nWikipedia: https://en.wikipedia.org/wiki/Ramsey_interferometry\n\n\n\n\n\n","category":"method"}]
